import axios from "axios";

async function getUserInfoOnLogin(email, password) {
  try {
    const res = await axios.post("http://localhost:4082/api/login", {
      email,
      password,
    });
  } catch (error) {
    console.log(error);
  }

  console.log(res.data);
}

export default getUserInfoOnLogin;
